using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// UIPrintFormatter is an abstract base class for print formatters: objects that lay out custom printable content that can cross page boundaries. Given a print formatter, the printing system can automate the printing of the type of content associated with the print formatter.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIPrintFormatter_Class/index.html#//apple_ref/occ/cl/UIPrintFormatter"/>    [iOSVersion(4.2)]    public class UIPrintFormatter : NSObject//, AnyObject, NSCopying, NSObjectProtocol    {        /// <summary>        /// Draws the portion of a print formatterâ€™s content that goes in the given area for the specified page        /// </summary>        /// <param name="rect">The area in which to draw the content.</param>        /// <param name="forPageAtIndex">The number of the page of content to draw.</param>        [iOSVersion(4.2)]        [Export("drawInRect")]        public void DrawInRect(CGRect rect, int forPageAtIndex) {  }                /// <summary>        /// Returns the area enclosing a specified page of content.        /// </summary>        /// <param name="pageIndex">The index number of a page.</param>        [iOSVersion(4.2)]        [Export("rectForPageAtIndex")]        public CGRect RectForPageAtIndex(int pageIndex) { return default(CGRect); }                /// <summary>        /// Removes the print formatter from the page renderer.        /// </summary>        [iOSVersion(4.2)]        [Export("removeFromPrintPageRenderer")]        public void RemoveFromPrintPageRenderer() {  }                /// <summary>        /// The distances the edges of content are inset from the printing rectangle.        /// </summary>        [iOSVersion(4.2)]        [Export("contentInsets")]        public UIEdgeInsets ContentInsets { get; set; }                /// <summary>        /// The margins for each printed page.        /// </summary>        [iOSVersion(8)]        [Export("perPageContentInsets")]        public UIEdgeInsets PerPageContentInsets { get; set; }                /// <summary>        /// The maximum height of the content area.        /// </summary>        [iOSVersion(4.2)]        [Export("maximumContentHeight")]        public CGFloat MaximumContentHeight { get; set; }                /// <summary>        /// The maximum width of the content area.        /// </summary>        [iOSVersion(4.2)]        [Export("maximumContentWidth")]        public CGFloat MaximumContentWidth { get; set; }                /// <summary>        /// The index of the first page that the print formatter lays out.        /// </summary>        [iOSVersion(4.2)]        [Export("startPage")]        public int StartPage { get; set; }                /// <summary>        /// The number of pages to be printed. (read-only)        /// </summary>        [iOSVersion(4.2)]        [Export("pageCount")]        public int PageCount { get; private set; }                /// <summary>        /// Returns the page renderer with which the receiver is associated.        /// </summary>        [iOSVersion(4.2)]        [Export("printPageRenderer")]        public UIPrintPageRenderer PrintPageRenderer { get; private set; }    }}